fragment TransactionItemFragment on TransactionItem {
  id
  vault {
    id
  }
  collection {
    id
  }
  tokenId
  amount
}

2451e7dbd652f6525df0747331c28a6322d75454:
query GetPairTransactions(
  $pair: ID!
  $skip: Int = 0
  $first: Int = 15
  $where: Transaction_filter
  $orderBy: Transaction_orderBy = timestamp
  $orderDirection: OrderDirection = desc
) {
  pair(id: $pair) {
    token0 {
      id
    }
    token1 {
      id
    }
    transactions(
      skip: $skip
      first: $first
      where: $where
      orderBy: $orderBy
      orderDirection: $orderDirection
    ) {
      id
      hash
      timestamp
      type
      user {
        id
      }
      amount0
      amount1
      amountUSD
      isAmount1Out
      items {
        ...TransactionItemFragment
      }
    }
  }
}

04b4c6d1c86d3f298b8aeb9d5b9bd0b30f1e0fb8:
query GetPairs(
  $skip: Int = 0
  $first: Int = 100
  $where: Pair_filter = { reserve0_gt: 0 }
  $orderBy: Pair_orderBy = reserveUSD
  $orderDirection: OrderDirection = desc
) {
  pairs(
    skip: $skip
    first: $first
    where: $where
    orderBy: $orderBy
    orderDirection: $orderDirection
  ) {
    ...PairFragment
    dayData(
      orderBy: date
      orderDirection: desc
    ) {
      ...PairDayDataFragment
    }
  }
}

ade09064317157ace46226a095cca04ebfd8aa1b:
query GetPair(
  $id: ID!
) {
  pair(id: $id) {
    ...PairFragment
    dayData(
      orderBy: date
      orderDirection: desc
    ) {
      date
      reserve0
      reserve1
      reserveUSD
      volume0
      volume1
      volumeUSD
      txCount
    }
  }
}

2dd1aad86f2e77d0af93040df670b19f9570e368:
query GetStats {
  factories {
    pairCount
    reserveNFT
    txCount
  }
}

8eac6dedf7134042bc953a25c66c0685cb8d5cb7:
fragment TokenFragment on Token {
  id
  name
  symbol
  decimals
  derivedMAGIC
  isNFT
  isMAGIC
  isETH
  vaultCollections {
    collection {
      id
      type
    }
    tokenIds
  }
  vaultReserveItems {
    tokenId
    amount
  }
}

1479bbe705969a0a352f08c8a8f42295cd958304:
query GetTokens(
  $skip: Int = 0
  $first: Int = 100
  $where: Token_filter
  $orderBy: Token_orderBy = symbol
  $orderDirection: OrderDirection = asc
) {
  tokens(
    skip: $skip
    first: $first
    where: $where
    orderBy: $orderBy
    orderDirection: $orderDirection
  ) {
    ...TokenFragment
  }
}

11dd826f7a0865dd4cacd1d013c5192f575a61b1:
query GetTokenVaultReserveItems(
  $id: String!
  $skip: Int = 0
  $first: Int = 50
  $orderBy: VaultReserveItem_orderBy = tokenId
  $orderDirection: OrderDirection = asc
) {
  vaultReserveItems(
    first: $first
    skip: $skip
    where: { vault: $id }
    orderBy: $orderBy
    orderDirection: $orderDirection
  ) {
    collection {
      id
    }
    tokenId
    amount
  }
}

a9535c67b4df9ae66cbe7153341997771fa337e0:
query GetUserPositions(
  $id: ID!
  $skip: Int = 0
  $first: Int = 100
  $where: LiquidityPosition_filter
  $dayDataWhere: PairDayData_filter
  $orderBy: LiquidityPosition_orderBy = balance
  $orderDirection: OrderDirection = desc
) {
  user(id: $id) {
    liquidityPositionCount
    liquidityPositions(
      first: $first
      skip: $skip
      where: $where
      orderBy: $orderBy
      orderDirection: $orderDirection
    ) {
      pair {
        ...PairFragment
        dayData(
          where: $dayDataWhere
          orderBy: date
          orderDirection: desc
        ) {
          ...PairDayDataFragment
        }
      }
      balance
    }
  }
}
